create table company_support
(
    id           bigint not null
        constraint company_support_pk
            primary key,
    company_name varchar(255)
        constraint company_support_crypto_company_name_fk
            references crypto_company (name),
    support      text
);

alter table company_support
    owner to application;

create unique index company_support_id_uindex
    on company_support (id);

